import React from 'react';

const CoachCard = ({ name, classes, image }) => {

    return (
        <div className="coachCard">
            <p>{name}</p>
            <p>{classes}</p>
            <img src={image} alt={name} />
        </div>
    );
}

export default CoachCard;
